import { useState } from 'react';
import {
  Box,
  Button,
  Container,
  Grid,
  Link,
  TextField,
  Typography,
} from "@mui/material";

const App = () => {
  const [mail, setMail] = useState('');
  const [pass, setPass] = useState('');
  const handleMailChange = (event) => {
    setMail(event.currentTarget.value);
